import Props from "./props";
import Api from "./api"

const apiData=(values)=>{
  return(
    <>
        <Props
          img={values.img}
          title={values.title}
          />
    </>
  )
}

let App = () => {
  return (

      <div className="container my-5">
        <div className="row">

      {Api.map(apiData)}

        </div>
      </div>

  )
};
export default App;
